import React, { Component } from "react";
import { connect } from "react-redux";
import image from "../images/food1.jpg";
import { Row, Col, Nav } from "react-bootstrap";
import DropdownButton from "react-bootstrap/DropdownButton";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import "../App.css";
class Home extends Component {
  render() {
    return (
      <Row>
        <Col>
          <img src={image} alt="food" className="homepage-image"></img>
        </Col>
        <Col className="homepage-content">
          <Navbar bg="light" variant="light">
            <Navbar.Brand href="/">GrubHub</Navbar.Brand>
            <Nav className="d-flex justify-content-end">
              <NavDropdown title="Sign in" id="SignIn">
                <NavDropdown.Item href="/">Customer</NavDropdown.Item>
                <NavDropdown.Item href="/">Owner</NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar>
        </Col>
      </Row>
    );
  }
}

function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(Home);
